description:
This is the newest beta Technic launcher from http://www.technicpack.net

In order to play, register for a freely available Minecraft account and use it to log in. The launcher will ignore that you haven't actually purchased Minecraft with the account. The usual cracked Minecraft limitations still apply, such as not being able to play on any server that isn't &quot;offline&quot; or &quot;cracked&quot;

I will try to keep somewhat current with their version and reupload accordingly.
